import React from 'react';
import ReturnReseT from './Reset';
import { useNavigate } from 'react-router-dom';

// Rest Main Compoennt 
export default function ReseT() {

 const navigation = useNavigate();
 React.useEffect(() => {
  JSON.parse(window.localStorage.getItem('ACTIVE')) != true && navigation('/');
  JSON.parse(window.localStorage.getItem('?bu%^%ild--#')) != true && navigation('/dash');

 }, []);

 return (
  <ReturnReseT />
 );
};
